export default (function(a,b,c,d,e,f,g,h,i,j,k,l){return {data:{"9EdY7FwJjp":{data:[{id:2745,attributes:{type:f,item_lang:{data:{id:3412,attributes:{title:"House of the Dragon",slug:"house-of-the-dragon"}}}}},{id:2747,attributes:{type:c,item_lang:{data:{id:3414,attributes:{title:"Bullet Train",slug:"bullet-train"}}}}},{id:2752,attributes:{type:c,item_lang:{data:{id:3419,attributes:{title:"White Noise",slug:"white-noise"}}}}},{id:2765,attributes:{type:c,item_lang:{data:{id:3432,attributes:{title:"Argylle",slug:"argylle"}}}}},{id:2772,attributes:{type:f,item_lang:{data:{id:3439,attributes:{title:"Super Pumped",slug:"super-pumped"}}}}}],meta:{pagination:{page:g,pageSize:25,pageCount:g,total:5}}},"5yachCjoPO":{data:{id:2118,attributes:{imdbId:"tt4139588",poster:"https:\u002F\u002Fm.media-amazon.com\u002Fimages\u002FM\u002FMV5BMzA5MjNjODEtOWYxYi00OTdmLTlhNTAtN2VhMTMxNWJjM2ZmXkEyXkFqcGdeQXVyMzY0MTE3NzU@._V1_SX300.jpg",type:c,ratings:[{Source:"Internet Movie Database",Value:"6.3\u002F10"},{Source:"Rotten Tomatoes",Value:"19%"},{Source:"Metacritic",Value:"19\u002F100"}],item_lang:{data:{id:2781,attributes:{title:h,plot:"A retiring assassin suddenly finds himself on the receiving end of a hit, contracted by none other than his own employer seeking to cash in on the pensions of aging employees.",slug:"polar"}}},books:{data:[{id:10467,attributes:{title:i,description:j,thumbnail:k,authors:[b],firstBook:true,published:l,publisher:d,subtitle:a}},{id:10468,attributes:{title:"Polar Volume 2 Eye for an Eye",description:"Left adrift in arctic waters with a gunshot wound to the head, adrift in arctic waters, Christy White was rescued from an icy death by a mysterious man. She craved retribution, and he taught her how to get it--how to make sense of her past and how to kill. They tried to freeze her out, but they should have finished the job, because now she's back with a vengeance! Collecting the second year of the bloody and beautiful silent webcomic by Victor Santos (The Mice Templar, Furious), this rage-fueled revenge story features new noir dialogue crafted by Santos for this edition.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=PbtvDwAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[b],firstBook:e,published:"2015-04-28",publisher:d,subtitle:a}},{id:10469,attributes:{title:"Polar: The Black Kaiser",description:"Now Netflix Movie with Mads Mikkelsen. A Cold War espionage agent with ice in his veins comes to the United States aiming to take out a political target, but the mission is never what it seems. The Black Kaiser, a name whispered in dark corners amongst power czars across the globe. A cold knife in the dark. A secret agent. Delve into the origin of the most feared assassin as his current mission lands him on American soil and in direct conflict with the nefarious agency known as the Damocles Initiative. New York Times Bestseller Victor Santos (Filthy Rich, Violent Love) takes you back to the beginning with the origin of his iconic character Black Kaiser! A violent and fast-paced thriller. Now a Major Motion Picture. Polar: The Origin of the Black Kaiser from Planeta-de-Agostini comics 2009",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=UNCIDwAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[b],firstBook:e,published:"2019-03-19",publisher:d,subtitle:a}},{id:10470,attributes:{title:h,description:"The basis of a Netflix Original Movie! Ripped out of retirement by an assassination attempt, the world's most deadly spy--the former agent known as Black Kaiser-is a wanted man that's wanted . . . dead! On a collision course with his former employer, the Damocles Agency, Black Kaiser goes head to head with a stab-happy, psychotic torture expert and a seductive but deadly redhead. His mission only ends if he dies or kills everyone out to get him, and he's not in the habit of dying. A guns-blazing espionage action-adventure in the grand tradition of Jim Steranko and Frank Miller, this graphic novel by Victor Santos (Mice Templar, Filthy Rich) is a brutal, fast-tempo story of revenge that Newsarama says is \"as ice-cold as its name.\" Originally a silent webcomic, but Santos has crafted a script as hard boiled and intriguing as his art for this hardcover collection.",thumbnail:a,authors:[b],firstBook:e,published:"2019-01-01",publisher:a,subtitle:"Came from the cold"}},{id:10471,attributes:{title:i,description:j,thumbnail:k,authors:[b],firstBook:e,published:l,publisher:d,subtitle:a}}]}}},meta:{}}},prerenderedAt:1681377252013}}("","Victor Santos","movie","Dark Horse Comics",null,"series",1,"Polar","Polar Volume 1: Came from the Cold (Second Edition)","The basis of a Netflix Original Movie! Ripped out of retirement by an assassination attempt, the world's most deadly spy--the former agent known as Black Kaiser--is a wanted man that's wanted . . . dead! On a collision course with his former employer, the Damocles Agency, Black Kaiser goes head to head with a stab-happy, psychotic torture expert and a seductive but deadly redhead. His mission only ends if he dies or kills everyone out to get him, and he's not in the habit of dying. A guns-blazing espionage action-adventure in the grand tradition of Jim Steranko and Frank Miller, this graphic novel by Victor Santos (Mice Templar, Filthy Rich) is a brutal, fast-tempo story of revenge that Newsarama says is \"as ice-cold as its name.\" Originally a silent webcomic, but Santos has crafted a script as hard boiled and intriguing as his art for this hardcover collection.","https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=Kt6DDwAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api","2019-01-17"))